  const BG_OFFSET = {
    normal: 9,
    dim: 5,
    bold: 16,
  };

  /**
   * Get background lightness by params.
   * @param [type] {String}
   * @param [highContrast] {Boolean}
   * @param [darkScheme] {Boolean}
   * @returns {Number}
   */
  function getBgLightness(type = 'normal', highContrast, darkScheme) {
    if (darkScheme) {
